import * as React from 'react';
import Box from '@mui/material/Box';
import styled from "styled-components";
import Drawer from '@mui/material/Drawer';
import AppBar from '@mui/material/AppBar';
import CssBaseline from '@mui/material/CssBaseline';
// import Toolbar from '@mui/material/Toolbar';
import List from '@mui/material/List';
// import Typography from '@mui/material/Typography';
// import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import MailIcon from '@mui/icons-material/Mail';
import { ReactComponent as Dashboard } from "../../assets/Sidebar Dashboard.svg";
import { ReactComponent as Calendar } from "../../assets/Sidebar Document Landscape Data.svg";
import { ReactComponent as Case } from "../../assets/Sidebar Briefcase.svg";
import { ReactComponent as DocumentSearch } from "../../assets/Sidebar Document Search.svg";

const drawerWidth = 240;

// const Drawer = styled(drawer)`
//   display: flex;
//   width: 1px;
//   background-color: #FFF;
//   margin: 10px;
// `

const StyledDashboardIcon = styled(Dashboard)`
  position: flex;
  width: 28px
`;

const StyledCalendarIcon = styled(Calendar)`
  position: flex;
  width: 28px
`;

const StyledCaseIcon = styled(Case)`
  position: flex;
  width: 28px
`;

const StyledDocumentSearchIcon = styled(DocumentSearch)`
  position: flex;
  width: 28px
`;

const ClippedDrawer = () => {

  return(
    <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <AppBar position="fixed" sx={{ zIndex: (theme) => theme.zIndex.drawer +1 }}>
      </AppBar>
      <Drawer
        variant="permanent"
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          zIndex: 1,
          [`& .MuiDrawer-paper`]: { width: drawerWidth, boxSizing: 'border-box' },
        }}
      >
        <Box sx={{ overflow: 'auto' }}>
          <List sx={{ pt:7,}}>
          <ListItemButton>
        <ListItemIcon>
        <StyledDashboardIcon />
        </ListItemIcon>
        <ListItemText primary="Dashboard" />
      </ListItemButton>

      <ListItemButton>
        <ListItemIcon>
        <StyledCalendarIcon />
        </ListItemIcon>
        <ListItemText primary="Calendar" />
      </ListItemButton>

      <ListItemButton>
        <ListItemIcon>
        <StyledCaseIcon />
        </ListItemIcon>
        <ListItemText primary="Case Management" />
      </ListItemButton>

      <ListItemButton>
        <ListItemIcon>
        <StyledDocumentSearchIcon />
        </ListItemIcon>
        <ListItemText primary="CAPO Investigation Report Record Enquiry" />
      </ListItemButton>

            {[ 'CAPO Investigation Report Record Enquiry', 'Complaint Record Check','Review of Complainee Record', 'CAPO Case Enquiry', 'Reporting', 'Data Analytic Tool', ].map((text, index) => (
              <ListItem key={text} disablePadding>
                <ListItemButton>
                  <ListItemIcon>
                    {index % 2 === 0 ? <StyledDashboardIcon /> : <MailIcon /> }
                  </ListItemIcon>
                  <ListItemText primary={text} />
                </ListItemButton>
              </ListItem>
            ))}
          </List>

        </Box>
      </Drawer>
      <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
      </Box>
    </Box>

  );

};

export default ClippedDrawer;
